informacaoComplementar:
No âmbito do CRP-06, foram desenhados e definidos em março de 2023 os Eixos e Resultados de Gestão 2023-2025 no Planejamento Estratégico.

Diante disso, surge a necessidade de desenvolver o Planejamento Operacional 2024 da Autarquia.

Para efetivo desenvolvimento do Planejamento Operacional 2024, é essencial que ocorra um processo de construção coletiva, envolvendo todos os níveis organizacionais do Conselho, bem como utilizando metodologias adequadas.

O Planejamento Operacional detém fundamental importância no que se refere à gestão, considerando seu papel como ferramenta para:

Transformação dos objetivos traçados no planejamento estratégico em ações a serem realizadas a curto e médio prazo;

Definição de responsáveis por tais ações, bem como pelo cumprimento dos prazos estabelecidos;

Levantamento e análise dos problemas enfrentados quando da realização das ações, além do desenho de estratégias para enfrentá-los visando à minimização de danos;

Previsão das necessidades orçamentárias, objetivando o desenvolvimento dessas ações durante o ano de 2024.

Assim, considerando o pressuposto de que, a fim de que as definições sejam eficazes e aplicáveis à realidade do Conselho, elas precisam ser construídas de maneira coletiva, com a participação de todas as equipes, é necessário que Oficinas de Trabalho sejam realizadas e facilitadas/moderadas, com a participação das diferentes equipes e instâncias do CRP-06 organizadas na forma de grupos, de modo a desenhar o Planejamento Operacional 2024.

Tendo em vista o exposto, justifica-se a contratação por parte deste Conselho Regional de Psicologia de empresa com notória especialização (H+K – Desenvolvimento Humano e Institucional) para a realização dos referidos serviços técnicos de natureza predominantemente intelectual.

A presente contratação visa garantir a prestação contínua, adequada e segura do serviço público de abastecimento de água potável e coleta de esgoto sanitário nas unidades vinculadas à CONTRATANTE, assegurando o atendimento às normas técnicas e legais vigentes, especialmente à Lei Federal nº 11.445/2007, com redação dada pela Lei nº 14.026/2020, e ao Regulamento de Serviços Públicos de Abastecimento de Água e Coleta de Esgotos Sanitários (Resolução nº 01/2012 da Agência de Serviços Públicos do Maranhão).

A CAEMA é a concessionária exclusiva desses serviços no Estado do Maranhão, configurando hipótese de inexigibilidade de licitação nos termos do art. 74, inciso I, da Lei nº 14.133/2021. A contratação visa assegurar a continuidade dos serviços essenciais, prevenindo riscos à saúde pública, ao meio ambiente e à regularidade das atividades institucionais.

A Contratação de empresa especializada (CAEMA) para a prestação de serviços públicos de abastecimento de água potável e coleta de esgoto sanitário, com fornecimento contínuo e medição mensal, nas condições estabelecidas em contrato, abrangendo todas as unidades da CONTRATANTE.

Inclui:

Fornecimento de água tratada dentro dos padrões de potabilidade;

Coleta, transporte e tratamento do esgoto sanitário gerado;

Instalação e manutenção de hidrômetros;

Medição regular do consumo e faturamento mensal;

Atendimento técnico para eventuais ajustes e manutenção emergencial. Com base no histórico das faturas de agosto/2024 a julho/2025, o valor médio mensal foi de R$ 24.244,75, totalizando uma estimativa anual de R$ 290.937,00 (duzentos e noventa mil, novecentos e trinta e sete reais).

O consumo médio mensal apurado com base nas faturas foi de 807 m³, tendo o volume real variado entre 620 m³ (mínimo, registrado em janeiro/2025) e 1.048 m³ (máximo, registrado em setembro/2024), de acordo com a demanda das unidades.

O valor efetivo da contratação poderá variar em função de alterações tarifárias da CAEMA, oscilações de consumo e variação inflacionária.

